import React from 'react';
import {GeneralMap} from './Map';
import {GraphicGroup} from './Graphic';

import CssBaseline from '@material-ui/core/CssBaseline';
import Drawer from '@material-ui/core/Drawer';
import Box from '@material-ui/core/Box';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import Badge from '@material-ui/core/Badge';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Link from '@material-ui/core/Link';

const graphic1 = {
  name: 'График небалансов между показаниями ПСК и ПУ',
  x: [1, 1.5, 1.6, 1.7, 1.9, 2.1, 2.3, 2.6, 2.8, 3.1, 3.3, 3.6, 3,9, 4.0, 4.2, 4.9, 5.1, 5.2, 5.3, 5.7, 5.8, 5.9, 6.3, 6.5, 6.8, 6.9, 7.2, 7.4, 7.8, 7.9, 8, 8.6, 8.8, 9.4, 9.5, 9.6, 10, 10.3, 10.4, 10.5],
  y: [-30, -10, -30, 30, 30, 40, 37, 7, 40, 25, 25, -4, -37, 36, 36, 40, 24, -1, -21, -1, -1, -21, 11, 40, -25, -25, 18, -15, -10, -40, 38, 10, 37, -30, -4, -4, -10, -40, -35, 10],
  type: 'bar'
};

export class BalanceGroup extends React.Component {
  render() {
    return (<div>
      <Drawer variant="permanent" classes={{
          // paper: clsx(classes.drawerPaper, !open && classes.drawerPaperClose),
        }} open={true}>
        THIS IS DRAWER
      </Drawer>
      <main >
        <Container maxWidth="lg">
          <Grid container="container" spacing={3}>
            <Grid item="item" xs={7} md={7} lg={7}>
              <Paper >
                <GeneralMap/>
              </Paper>
            </Grid>
            <Grid item="item" xs={5} md={5} lg={5}>
              <Paper >
                <GraphicGroup/>
              </Paper>
            </Grid>
            <Grid item="item" xs={12} md={12} lg={12}>
              <Paper >
                <GraphicGroup/>
              </Paper>
            </Grid>
            <Grid item="item" xs={12} md={12} lg={12}>
              <Paper >
                <GraphicGroup/>
              </Paper>
            </Grid>
          </Grid>
        </Container>
      </main>
    </div>);
  }
}
